import React from 'react';
import { Parallax } from 'react-scroll-parallax'

function Header() {
    const text = 'Parallax'.split('');
    return (
        <div>
        <span>
            {text.map((letter, i) => (
                <Parallax
                    key={`text-${i}`}
                    offsetXMax={100 * (i - 3)}
                >
                    {letter}
                </Parallax>
            ))}
        </span>
    </div>
    );
}

export default Header;
